ar han besluttet sig for at vende tilbage til sine evner som spion/agent og forhåbentligt gøre en forskel ved at gå efter mere strategiske mål som har indflydelse. Folk som korrupte politikere, bandit ledere og deslige\\n\\nSit kaldenavn \\logseq____&quot;[[Lark]]\\logseq____&quot; fik han som barn som kodenavn hos sin kontakt fordi han var god til at imitere fuglelyde/sang og holdt til i skovenlogseq____&quot;,536871027]],[logseq____&quot;^15logseq____&quot;,[1249,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^1?logseq____&quot;,536871027]],[logseq____&quot;^15logseq____&quot;,[1249,logseq____&quot;^Flogseq____&quot;,1242,536871027]],[logseq____&quot;^15logseq____&quot;,[1249,logseq____&quot;^Xlogseq____&quot;,20,536871027]],[logseq____&quot;^15logseq____&quot;,[1249,logseq____&quot;^Vlogseq____&quot;,20,536871027]],[logseq____&quot;^15logseq____&quot;,[1249,logseq____&quot;^Ulogseq____&quot;,20,536871027]],[logseq____&quot;^15logseq____&quot;,[1249,logseq____&quot;^?logseq____&quot;,[logseq____&quot;^ logseq____&quot;,logseq____&quot;^3Elogseq____&quot;,3],536871027]],[logseq____&quot;^15logseq____&quot;,[1249,logseq____&quot;^Jlogseq____&quot;,[],536871027]],[logseq____&quot;^15logseq____&quot;,[1249,logseq____&quot;^Hlogseq____&quot;,20,536871027]],[logseq____&quot;^15logseq____&quot;,[1249,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u662b701f-9bed-4db8-89b3-76b22138d708logseq____&quot;,536871027]],[logseq____&quot;^15logseq____&quot;,[1250,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;Has lost 2 teeth in a betlogseq____&quot;,536871027]],[logseq____&quot;^15logseq____&quot;,[1250,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^1?logseq____&quot;,536871027]],[logseq____&quot;^15logseq____&quot;,[1250,logseq____&quot;^Flogseq____&quot;,1244,536871027]],[logseq____&quot;^15logseq____&quot;,[1250,logseq____&quot;^Xlogseq____&quot;,20,536871027]],[logseq____&quot;^15logseq____&quot;,[1250,logseq____&quot;^Vlogseq____&quot;,1243,536871027]],[log
